import React from "react";
import { useDispatch, useSelector } from "react-redux";
import {
  decreaseCounter,
  increaseCounter,
  increaseCounterByValue,
} from "../Store/Slice/CartSlice";

export default function Counter() {
  const counter = useSelector((state) => state.counter.counter_val);
  const dispatch = useDispatch();

  return (
    <div>
      <h2>Counter App</h2>
      <hr />
      <div className="d-flex">
        <button className="btn btn-danger me-3"> -5 </button>
        <button
          className="btn btn-danger"
          onClick={() => dispatch(decreaseCounter())}
        >
          -1
        </button>
        <h4 className="mx-3">{counter}</h4>
        <button
          className="btn btn-success"
          onClick={() => dispatch(increaseCounter())}
        >
          +1
        </button>
        <button
          className="btn btn-success ms-3"
          onClick={() => dispatch(increaseCounterByValue(5))}
        >
          +5
        </button>
      </div>
    </div>
  );
}
